import React from 'react';
import { Carousel } from 'react-bootstrap';
import '../styles/CategoryButtons.css'; // Import your CSS file
import parrot1 from '../images/birds/;'


const CategoryButtons = () => {
  return (
    <div className="main-banner-container">
      {/* Carousel 1 */}
      <Carousel>
        <Carousel.Item>
          <img src={parrot1} alt="Image 1" className="carousel-image" />
        </Carousel.Item>
        <Carousel.Item>
          <img src="../images/birds/parrot2.jpeg" alt="Image 2" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>

      {/* Carousel 2 */}
      <Carousel>
        <Carousel.Item>
          <img src="../images/your-image2.jpg" alt="Image 3" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>

      {/* Carousel 3 */}
      <Carousel>
        <Carousel.Item>
          <img src="../images/your-image3.jpg" alt="Image 4" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>

      {/* Carousel 4 */}
      <Carousel>
        <Carousel.Item>
          <img src="../images/your-image4.jpg" alt="Image 5" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>

      {/* Carousel 5 */}
      <Carousel>
        <Carousel.Item>
          <img src="../images/your-image5.jpg" alt="Image 6" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>
    </div>
  );
};

export default CategoryButtons;
